(985, 'en', 'wpml-string-translation', 'baedfa4e993938cc78b432cbe7df4cbd', 'Some of the strings selected belong to packages. You can only change the language of these strings if all strings in the packages are selected.', NULL, NULL, 'LINE', NULL, 10, '', '44631af095c978a3f6ef9760321504be', '', NULL),
