(987, 'en', 'wpml-string-translation', '88a40e37b36b3286ce762470519c69cd', 'Some themes and plugins have huge .mo files that take a long time to load. WPML already knows the strings in these files and loads only the necessary strings to display each page.', NULL, NULL, 'LINE', NULL, 10, '', '0583ac20f3d688be1dcfd5cf781e30da', '', NULL),
