(5052, 'en', 'default', '3ded626b75eebf44c0ca7a8587f84801', 'Creating a Page is very similar to creating a Post, and the screens can be customized in the same way using drag and drop, the Screen Options tab, and expanding/collapsing boxes as you choose. This screen also has the distraction-free writing space, available in both the Visual and Text modes via the Fullscreen buttons. The Page editor mostly works the same as the Post editor, but there are some Page-specific features in the Page Attributes box.', NULL, NULL, 'LINE', NULL, 0, '', '88d63d26a5d5ac5eef99a90931171ac9', '', NULL),
(5053, 'en', 'default', 'aaf0eacd2910ab72ba554324323a55de', 'About Pages', NULL, NULL, 'LINE', NULL, 0, '', '81845170e7e36c133340d3cb786e68e8', '', NULL),
(5054, 'en', 'default', 'ca6e165a9d16e3545b1b99ba982bc237', '<a href="https://codex.wordpress.org/Pages_Add_New_Screen">Documentation on Adding New Pages</a>', NULL, NULL, 'LINE', NULL, 0, '', 'e2f15b1c17703fe7799ab93670793fa9', '', NULL),
(5055, 'en', 'default', 'acd276c29c2b3a6a46c69be6455f539e', '<a href="https://codex.wordpress.org/Pages_Screen#Editing_Individual_Pages">Documentation on Editing Pages</a>', NULL, NULL, 'LINE', NULL, 0, '', '8175a56cdb835f9c9c28759066446f99', '', NULL),
(5056, 'en', 'default', 'e4d5552eac3895bbac77d104bb1ac888', 'You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.', NULL, NULL, 'LINE', NULL, 0, '', '63c19f99a08798af50e2a88aa8044305', '', NULL),
(5057, 'en', 'default', '5860a8fa3ef1ea4cf6657c47ed83e90c', 'You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. Please refer to the Codex to <a href="https://codex.wordpress.org/Embeds">learn more about embeds</a>.', NULL, NULL, 'LINE', NULL, 0, '', 'c214466f990742e589dfd33015c4c203', '', NULL),
(5058, 'en', 'default', '168108e3b4fee6afab9dcf41920dec8a', 'Inserting Media', NULL, NULL, 'LINE', NULL, 0, '', 'bf22cc275e0dd347a2945311d7fdecac', '', NULL),
(5059, 'en', 'default', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', NULL, NULL, 'LINE', NULL, 0, '', 'a7d363674bc0d711d6d160e3dbf13846', '', NULL),
(5060, 'en', 'default', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', NULL, NULL, 'LINE', NULL, 0, '', '62319763264b08b9688c6a9f025316ba', '', NULL),
(5061, 'en', 'default', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', NULL, NULL, 'LINE', NULL, 0, '', 'f11c47af7f98788ea05b855c41902aa2', '', NULL),
(5062, 'en', 'sitepress', '666515197822288293861436f99e96cb', 'You are about to change the language of {post_name}.', NULL, NULL, 'LINE', NULL, 0, '', '3239b3b8af7ca3b3bf4acdff464bc111', '', NULL),
