(5892, 'en', 'default', 'cbdda47072ae4fe0db4cc67e2af00351', 'The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Publish &amp; Activate button above the menu.', NULL, NULL, 'LINE', NULL, 0, '', '946fd2b46a344499284444761c8fbc01', '', NULL),
(5893, 'en', 'default', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, NULL, 'LINE', NULL, 0, '', 'ec0c3d224b684a115d955d14d78a3c2b', '', NULL),
