INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(7313, 'en', 'default', '893b004b3b255507cc8437e21994eadb', 'You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.', NULL, NULL, 'LINE', NULL, 0, '', '014d2d802fc8f834f23987d4b037d30a', '', NULL),
(7314, 'en', 'default', '69bf2bc0a778d2be3e4a04bc44a4f549', 'You can view posts in a simple title list or with an excerpt using the Screen Options tab.', NULL, NULL, 'LINE', NULL, 0, '', '186aa98f7201ceb39e7ebc98f6e8a5ae', '', NULL),
(7315, 'en', 'default', 'a4e5684835acb802ee3194c309c7ed1a', 'You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.', NULL, NULL, 'LINE', NULL, 0, '', '392e9b74ecaedf4daa058dcc790516c4', '', NULL),
(7316, 'en', 'default', '0f05ceec0844c366727708a4f37bc8d4', 'Available Actions', NULL, NULL, 'LINE', NULL, 0, '', 'a3fa5d45dca47859e6e25303d750fba0', '', NULL),
(7317, 'en', 'default', '324a8e205fd6e1ed56142378c52931a8', 'Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:', NULL, NULL, 'LINE', NULL, 0, '', 'fec1189b4b1f2a26e07f6552c036bacd', '', NULL),
(7318, 'en', 'default', '0bdd62cf14b1ac2df851e97eed7faa8c', '<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.', NULL, NULL, 'LINE', NULL, 0, '', '74deb9541548900791736df7e47727d1', '', NULL),
(7319, 'en', 'default', '099f3df0632488f2c47e2658d95e0e76', '<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.', NULL, NULL, 'LINE', NULL, 0, '', 'aec7db39f9755f7c2dc6e2b37c8412c2', '', NULL),
(7320, 'en', 'default', '1ac12183049e2cd887bb8ee6b488d5fb', '<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.', NULL, NULL, 'LINE', NULL, 0, '', 'fb4aa500e080edf20572554e14786e36', '', NULL),
(7321, 'en', 'default', 'b807523847b38ac8553394a6e915ef62', '<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.', NULL, NULL, 'LINE', NULL, 0, '', 'feb9ddd4b67850aee6a2151805f1dfa8', '', NULL),
(7322, 'en', 'default', 'c83a2faddec053e93996bea49df84dd8', 'You can also edit or move multiple posts to the trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.', NULL, NULL, 'LINE', NULL, 0, '', '95e6f8b591af95b7e141df1318db45fb', '', NULL),
(7323, 'en', 'default', '4fd5e879927f19de076cca45bc59434a', 'When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.', NULL, NULL, 'LINE', NULL, 0, '', 'd70e008926f797f7fa73820eeb9729d4', '', NULL),
(7324, 'en', 'default', 'a9dc838f59eca462ebe982579896d22f', '<a href="https://codex.wordpress.org/Posts_Screen">Documentation on Managing Posts</a>', NULL, NULL, 'LINE', NULL, 0, '', '9bce89575b26198d76b70b2355e59b5e', '', NULL),
