(7358, 'en', 'sitepress', '1a6e190df5b5de5d270f4c1d1a1117d8', 'This operation will synchronize this translation with the original language. When you edit the original, this translation will update immediately. It''s meant when you want the content in this language to always be the same as the content in the original language.', NULL, NULL, 'LINE', NULL, 0, '', 'c3c863ad44bc3c9625a16cac708aedb8', '', NULL),
