(7428, 'en', 'default', '33da0d47041802e3fd26e5365065010a', 'This screen contains the settings that affect the display of your content.', NULL, NULL, 'LINE', NULL, 0, '', '0d6aff48207c056f0e11a40873fd9a8b', '', NULL),
(7429, 'en', 'default', 'f84196c911ec5a65c48ccee53f33c850', 'You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.', NULL, NULL, 'LINE', NULL, 0, '', '649280ffbec104f0b86be27e09164287', '', NULL),
(7430, 'en', 'default', '6b872e2b359ab19726c69cfc6662980b', 'You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or a summary.', NULL, NULL, 'LINE', NULL, 0, '', 'ac7ebf12f6abef2a950abe5280a54102', '', NULL),
(7431, 'en', 'default', 'f5752ab5c7a0fb0f40be53417ace7247', 'Search Engine Visibility', NULL, NULL, 'LINE', NULL, 0, '', '7cb2843c487aedb2909244818df8fdf8', '', NULL),
(7432, 'en', 'default', '0754b49868a7a0ac641085882e136d75', 'You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen. Note that your privacy is not complete; your site is still visible on the web.', NULL, NULL, 'LINE', NULL, 0, '', '1051f547d613d166e58ee2267ea6046e', '', NULL),
(7433, 'en', 'default', '4210a86ca0a86ebdf5712c60c47a01ca', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search Engines Discouraged,&#8221; to remind you that your site is not being crawled.', NULL, NULL, 'LINE', NULL, 0, '', '33960768ca0efb2109671f1ab02318f6', '', NULL),
(7434, 'en', 'default', '683f4106f8e5ad2034b19900421a4f8e', '<a href="https://codex.wordpress.org/Settings_Reading_Screen">Documentation on Reading Settings</a>', NULL, NULL, 'LINE', NULL, 0, '', '8bcd56596f7cc9e41ad8785e74eac871', '', NULL),
