(7608, 'en', 'sitepress', '731485d58eafc5a7b737c6c2504cfd15', 'The ''Reset'' action will deactivate the WPML plugin after it deletes the WPML tables (tables with the ''icl_'' prefix) from the database.\r\n			The action will NOT delete any content (posts, taxonomy terms etc.).\r\n			It only affects translation and language information that WPML associates with each content type.', NULL, NULL, 'LINE', NULL, 0, '', '644fc947e1592da927dbc74fb8e77ef6', '', NULL),
(7609, 'en', 'sitepress', '84b860ad41026e79f84f4f776d770abf', 'Please note that all translations you have sent to remote translation services will be lost if you reset WPML''s data. They cannot be recovered later.', NULL, NULL, 'LINE', NULL, 0, '', '21db4faedceb3bd7ad4a92709bb425f5', '', NULL),
