(8247, 'en', 'wp_all_import_plugin', 'c98a899c7838642da172f20e72fdd836', 'This service is provided by Soflyy, the company that makes WP All Import. Automatic Scheduling makes it very easy to run imports on a schedule.', NULL, NULL, 'LINE', NULL, 0, '', 'ad45f9d07dbc7dea3519a5eb6d9fa916', '', NULL),
(8248, 'en', 'wp_all_import_plugin', '359f9e79e746fa9f684e5cda9e60ca2e', 'How does it work?', NULL, NULL, 'LINE', NULL, 0, '', 'e805e8558e2448baf5814460eb3f6f9f', '', NULL),
(8249, 'en', 'default', 'f86f5944fa4e3f2a4b2c0ba458cd9cbf', 'When you set an import to run on a schedule, our servers will contact your site to make sure that your import starts when you want it to. Our servers will check back every minute to make sure that the import is still running, and will continue doing so until it finishes.', NULL, NULL, 'LINE', NULL, 0, '', '4afc6bc9ebf223db24935050e5a6f3b0', '', NULL),
(8250, 'en', 'wp_all_import_plugin', '1508df028453cc70ce5e04896c09710b', 'Why does it cost money?', NULL, NULL, 'LINE', NULL, 0, '', 'e2a190dffa8755937f5bf4c06b690240', '', NULL),
(8251, 'en', 'default', '21d9338c6db581406ae269e6a51ce105', 'Your data is very important to us. We have a very resilient, scalable cluster of servers powering Automatic Scheduling. Our highly qualified team is on call 24hrs a day, 7 days a week to make sure your imports run when you need them to run.', NULL, NULL, 'LINE', NULL, 0, '', '5688a9908f487b341d8d7c3d3f911b2f', '', NULL),
(8252, 'en', 'wp_all_import_plugin', 'c6c166611cc8b0ff37aaac11171b5076', 'What do I get for $9 a month?', NULL, NULL, 'LINE', NULL, 0, '', '9e383e253a877fb576801b10a638dfdb', '', NULL),
(8253, 'en', 'default', '9571559a20376b2dcba6b7f137e1b3ee', 'You''ll receive a license key for Automatic Scheduling that you can use in WP All Import and WP All Export. You can set up as many imports and exports on as many sites as you like. We do ask, however, that you not share your license with anyone else.', NULL, NULL, 'LINE', NULL, 0, '', 'c3776f15a6a053f8c83c4c42bcf80556', '', NULL),
(8254, 'en', 'wp_all_import_plugin', '25f93ffbf5729417277135a7149e910a', 'What information is shared with Soflyy?', NULL, NULL, 'LINE', NULL, 0, '', 'e9d85da0a5e35d88fe1cdb25ad2f6d40', '', NULL),
(8255, 'en', 'default', '5752e471d00e33738881a2c70710f29f', 'When you set an import to run on a schedule, WP All Import will open an encrypted connection to our servers and send your license key, your site URL, the ID of the import you want to run, the import security key, and the times that you want the import to run.', NULL, NULL, 'LINE', NULL, 0, '', '67a26709f8b319c7be89908da2f87816', '', NULL),
