(8262, 'en', 'wp_all_import_plugin', '6e52c40bb8fc91ff39ee5c79b4211f67', 'records', NULL, NULL, 'LINE', NULL, 0, '', '94db71ea57782d64807f9c873e296bee', '', NULL),
(8263, 'en', 'wp_all_import_plugin', 'c133b08f3db8d1a0d38acd75e9bbdc76', 'WP All Import must be able to process this many records in less than your server''s timeout settings. If your import fails before completion, to troubleshoot you should lower this number. If you are importing images, especially high resolution images, high numbers here are probably a bad idea, since downloading the images can take lots of time - for example, 20 posts with 5 images each = 100 images. At 500Kb per image that''s 50Mb that needs to be downloaded. Can your server download that before timing out? If not, the import will fail.', NULL, NULL, 'LINE', NULL, 0, '', '01a766e4aa37b70211e05b39aebe7c22', '', NULL),
(8264, 'en', 'wp_all_import_plugin', '4cbb279370b040b5b6588fb383f91734', 'Split file up into <strong>1000</strong> record chunks.', NULL, NULL, 'LINE', NULL, 0, '', 'a2b364993a8c12c54341b46891ed412b', '', NULL),
(8265, 'en', 'wp_all_import_plugin', 'dbe2049f3faf3a51a11f3e92a6cd55ae', 'This option will decrease the amount of slowdown experienced at the end of large imports. The slowdown is partially caused by the need for WP All Import to read deeper and deeper into the file on each successive iteration. Splitting the file into pieces means that, for example, instead of having to read 19000 records into a 20000 record file when importing the last 1000 records, WP All Import will just split it into 20 chunks, and then read the last chunk from the beginning.', NULL, NULL, 'LINE', NULL, 0, '', 'f036451c767c2bf9d2c88eab62b1cbc9', '', NULL),
(8266, 'en', 'wp_all_import_plugin', '8854ed27c528af407b2703b4d811b872', 'Increase speed by disabling do_action calls in wp_insert_post during import.', NULL, NULL, 'LINE', NULL, 0, '', 'c93bad6a0e4e52dd8c9f0d66a04c2609', '', NULL),
(8267, 'en', 'wp_all_import_plugin', '875d8f5c0038683ea19646f28d02c2b0', 'This option is for advanced users with knowledge of WordPress development. Your theme or plugins may require these calls when posts are created. Next action will be disabled: ''transition_post_status'', ''save_post'', ''pre_post_update'', ''add_attachment'', ''edit_attachment'', ''edit_post'', ''post_updated'', ''wp_insert_post''. Verify your created posts work properly if you check this box.', NULL, NULL, 'LINE', NULL, 0, '', '4b17f1c904cc96970f5afae54fae69f3', '', NULL),
