(8578, 'en', 'default', '536f7f35770e99a3c83984d589a7e2c1', 'You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.', NULL, NULL, 'LINE', NULL, 0, '', '2ddc8f8aa19c7d488c4cf1ec77e75812', '', NULL),
