(8580, 'en', 'default', '547bb7bc331d5f8a0c52c01d87547377', 'Clicking an item will display an Attachment Details dialog, which allows you to preview media and make quick edits. Any changes you make to the attachment details will be automatically saved.', NULL, NULL, 'LINE', NULL, 0, '', '793e85515191328f2b8d99e53c62302c', '', NULL),
(8581, 'en', 'default', '7b3a2d31cc961302dc9eeb5b6f4e8b06', 'Use the arrow buttons at the top of the dialog, or the left and right arrow keys on your keyboard, to navigate between media items quickly.', NULL, NULL, 'LINE', NULL, 0, '', '328e1753cda1d3004044beea10d65926', '', NULL),
