(8659, 'en', 'default', '5b5dc2be55116d8466b06d4d75c19e38', 'By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you don&#8217;t want to send the new user a welcome email.', NULL, NULL, 'LINE', NULL, 0, '', 'ea0cd33171ea210e9f7f548627f323a2', '', NULL),
(8660, 'en', 'default', '7a1e520f1b0058411275a87501d2a715', 'Remember to click the Add New User button at the bottom of this screen when you are finished.', NULL, NULL, 'LINE', NULL, 0, '', '33400ae63c725abe2d292fc1856b43d5', '', NULL),
(8661, 'en', 'default', '7cc2d2e46cec80108de65235b279edea', 'User Roles', NULL, NULL, 'LINE', NULL, 0, '', '2412206efb448968c84b58331b2afcce', '', NULL),
(8662, 'en', 'default', '87f30a98fa31bb1fe8a78447ec3f5e34', 'Here is a basic overview of the different user roles and the permissions associated with each one:', NULL, NULL, 'LINE', NULL, 0, '', 'ea3aee4a8d9f78f391f56d57b3bed8d1', '', NULL),
(8663, 'en', 'default', 'e5d6f47be74ac1649baf2c9f844cbbf1', 'Subscribers can read comments/comment/receive newsletters, etc. but cannot create regular site content.', NULL, NULL, 'LINE', NULL, 0, '', '9fc099978c6e4c67b0fd9b3c16caf5bb', '', NULL),
(8664, 'en', 'default', 'cd52426764bdf16f1688535f7a2f5deb', 'Contributors can write and manage their posts but not publish posts or upload media files.', NULL, NULL, 'LINE', NULL, 0, '', '6b29a4e6fe28e153aaca4a513ec2ba19', '', NULL),
(8665, 'en', 'default', '3425f8a92f8d1df6ac44e3e6ddeee23d', 'Authors can publish and manage their own posts, and are able to upload files.', NULL, NULL, 'LINE', NULL, 0, '', 'fe63891a4190580d320d6345678728ab', '', NULL),
(8666, 'en', 'default', '45f073231aa37165563ce0acdf694a4c', 'Editors can publish posts, manage posts as well as manage other people&#8217;s posts, etc.', NULL, NULL, 'LINE', NULL, 0, '', '83c75c02d17165315d25c78067551eee', '', NULL),
(8667, 'en', 'default', 'f477b51748658015abe3b4f97cf87f04', 'Administrators have access to all the administration features.', NULL, NULL, 'LINE', NULL, 0, '', '4999bf15c5cba3faaa57696f785d9f36', '', NULL),
(8668, 'en', 'default', 'c620450055e69fc4bba257608038a252', '<a href="https://codex.wordpress.org/Users_Add_New_Screen">Documentation on Adding New Users</a>', NULL, NULL, 'LINE', NULL, 0, '', '69962bd767008a13556402ca4ae8b03f', '', NULL),
(8669, 'en', 'default', '65620e63dd694a02d1e257c54c1727cc', 'Create a brand new user and add them to this site.', NULL, NULL, 'LINE', NULL, 0, '', '79d3428706da5c9ca161aadc96e9ca54', '', NULL);
