(8690, 'en', 'default', '662ac82e28a30d435d809c4dbf1cd6ed', '[%s] New User Registration', NULL, NULL, 'LINE', NULL, 0, '', '3b8374d0fd166215f13827713da10b23', '', NULL),
(8691, 'en', 'default', '0dd321bd7f02eee4f60ac86a9a88d911', 'This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.', NULL, NULL, 'LINE', NULL, 0, '', '9e7ade8c38be740b58f044bf1278fb0a', '', NULL),
(8692, 'en', 'default', 'd93444b6125d6f7511ed541f8ea2b16f', 'To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.', NULL, NULL, 'LINE', NULL, 0, '', '18f746f02d07ad622b4a0b5c22b807d2', '', NULL),
(8693, 'en', 'default', '3f1914dd8eecd9de86a33cddc8389cbb', 'You can customize the display of this screen in a number of ways:', NULL, NULL, 'LINE', NULL, 0, '', '75b6f3ea46162ff1ee094bb0533bebb6', '', NULL),
(8694, 'en', 'default', '67e7c46d3d5c2108c0e99ceea6441dee', 'You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.', NULL, NULL, 'LINE', NULL, 0, '', '48e4f7cb4f7122f5b317b5c99b0da496', '', NULL),
(8695, 'en', 'default', '336a3ba49f4fd88e0d9f10b69511d0df', 'You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.', NULL, NULL, 'LINE', NULL, 0, '', '8653fbcfa867f1c95e2d3b856e2d8b47', '', NULL),
(8696, 'en', 'default', '809cd0ac3a99a17e88b7af070dcb1d97', 'You can view all posts made by a user by clicking on the number under the Posts column.', NULL, NULL, 'LINE', NULL, 0, '', '057d0d295c4e9c03bbba615601760927', '', NULL),
(8697, 'en', 'default', '40aa7c670adcc53d50a2eb0d9f434b57', 'Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:', NULL, NULL, 'LINE', NULL, 0, '', '6f27db27336dac372eb7553c49122b5b', '', NULL),
(8698, 'en', 'default', '9b0ce93b03db1e1cd98decc6387fa90c', '<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.', NULL, NULL, 'LINE', NULL, 0, '', '11696b2610f2bbca1738397defd5ba29', '', NULL),
(8699, 'en', 'default', '009d122ea5b480829aa49478250882f2', '<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.', NULL, NULL, 'LINE', NULL, 0, '', '6f347940b95b62848846a02047a935e5', '', NULL),
(8700, 'en', 'default', '8f061153d2c25d044ccf4667c47df950', '<a href="https://codex.wordpress.org/Users_Screen">Documentation on Managing Users</a>', NULL, NULL, 'LINE', NULL, 0, '', '90e62c69b88096b58347e5aa105664c7', '', NULL),
