(9013, 'en', 'advanced-access-manager', 'b6bbcd3cab4d154ad54930794c28bed8', 'Manage access for your users, roles and visitors. Be careful with [Administrator] role as well as your admin user. [Database backup is strongly recommended].', NULL, NULL, 'LINE', NULL, 0, '', 'bf1a3469b3825a0dd816dee456dd5918', '', NULL),
(9014, 'en', 'advanced-access-manager', '018c435e2da915c3f94ad3de381dc971', 'With Roles tab you can manage access for any defined role, edit role''s name, create new role or even delete existing (but only when there is no users assigned to it). You are not allowed to delete Administrator role.', NULL, NULL, 'LINE', NULL, 0, '', 'b30bdecb90badda392f6c838568824a0', '', NULL),
(9015, 'en', 'advanced-access-manager', '63923faaeca90202c4ee46b6854f558b', 'Manage access for any user. As a bonus feature, you can block user. It means that user will be not able to login to your website anymore.', NULL, NULL, 'LINE', NULL, 0, '', 'abcca6b22270137e07011a19bb6fa280', '', NULL),
(9016, 'en', 'advanced-access-manager', '208830ad9e2aa705967be030c1ccc3fb', 'Visitor can be considered any user that is not authenticated to your website.', NULL, NULL, 'LINE', NULL, 0, '', 'e7bb298773760fda8a738702fbe3be87', '', NULL),
(9017, 'en', 'advanced-access-manager', '2cd57db33b0a5c6c451625fe9cc8bf56', 'Manage default access settings to your website resources for all users, roles and visitors.', NULL, NULL, 'LINE', NULL, 0, '', '9982a542c8a7622a688694114d33723b', '', NULL),
(9042, 'en', 'advanced-access-manager', '2cdaff88dad8fbad83f04350a330c097', 'Appreciate your interest in Advanced Access Manager (aka AAM). With strong knowledge and experience in WordPress, AAM becomes a very powerful tool to manage access to your frontend, backend and RESTful/XML-PRC APIs.', NULL, NULL, 'LINE', NULL, 0, '', 'b2a9b7e3ea50e1a4cbe1089882de6c9d', '', NULL),
(9043, 'en', 'advanced-access-manager', '2e6b4c835ca3d319ea94867026bbb97a', 'Please Note!', NULL, NULL, 'LINE', NULL, 0, '', '5ed4cc3d4c9ca349d3c53bc1c269fe84', '', NULL),
(9044, 'en', 'advanced-access-manager', '68520dcdc77c8a011649b3893705f590', 'Power comes with responsibility. Make sure you have good understanding of %sWordPress Roles & Capabilities%s because AAM is very closely integrated with WordPress core. It is also recommended to have a backup of your database before you start working with AAM. There is no need to backup your files; AAM does not modify any physical files on your server and never did.', NULL, NULL, 'LINE', NULL, 0, '', 'ca8d4ef3a644811ade53d9a979e7960e', '', NULL),
(9045, 'en', 'advanced-access-manager', '11ebe9d69cb7c9c9c8af02f86bf6aa61', 'AAM was thoroughly tested on the fresh installation of WordPress and in the latest versions of Chrome, Safari, IE and Firefox. If you have any issues, the most typical case is a conflict with other plugins or themes. In this case please do not hesitate to contact us directly on our website %saamplugin.com%s', NULL, NULL, 'LINE', NULL, 0, '', 'd821ce8b00a30330a63714192cddcc45', '', NULL),
(9046, 'en', 'advanced-access-manager', 'e180221f4bd215bd00b3a1b2165fe9aa', 'If you are not sure where to start, please check our %s"Get Started"%s page to learn more about core concepts that will definitely help you to manage access to your WordPress website more effectively.', NULL, NULL, 'LINE', NULL, 0, '', '531e699671faf29d6a68d76285b676bd', '', NULL),
