(10748, 'en', 'advanced-access-manager', '3e45e0318cb765fbde31c79e6e731f85', 'Allow AAM to manage access to the backend. Keep this option disabled if there is no needs to restrict backend features for other users.', NULL, NULL, 'LINE', NULL, 0, '', '06ead2a16da3bf8547afec440e520ee0', '', NULL),
(10749, 'en', 'advanced-access-manager', '6f62fb2c46a1128344d07e0531c8e60d', 'Frontend Access Control', NULL, NULL, 'LINE', NULL, 0, '', '8fd5237f34b1bfab42d567bfb9148fde', '', NULL),
(10750, 'en', 'advanced-access-manager', '61bf0d15410f45c4a8b29080366e0d63', 'Allow AAM to manage access to the frontend. Keep this option disabled if there is no needs to restrict frontend resources for users and visitors.', NULL, NULL, 'LINE', NULL, 0, '', 'ff913edcc47bb136fcc693dc7073ba19', '', NULL),
(10751, 'en', 'advanced-access-manager', '7364e6cca2c2220fdee392aab93473cc', 'API Access Control', NULL, NULL, 'LINE', NULL, 0, '', '54ac85b141b503842c20ef0b4928f327', '', NULL),
(10752, 'en', 'advanced-access-manager', '6c797e14e3baf52f252483efa7b584ab', 'Allow AAM to manage access to the website resources that are invoked with WordPress core APIs. Keep this option disabled if there is no needs to restrict API access.', NULL, NULL, 'LINE', NULL, 0, '', 'c12983dc86381863c7e5d440ffab7aa6', '', NULL),
(10753, 'en', 'advanced-access-manager', '7d94c36490a3e53df4c60e30e29d8bfb', 'Render Access Manager Metabox', NULL, NULL, 'LINE', NULL, 0, '', '46176a2c6b7c43718452afb481d6594a', '', NULL),
(10754, 'en', 'advanced-access-manager', '8a14200860867e755307d8aee2443922', 'Render Access Manager metabox on all post and term edit pages. Access Manager metabox is the quick way to manage access to any post or term without leaving an edit page.', NULL, NULL, 'LINE', NULL, 0, '', 'bfa84d20f71b0ebcb37b350905da3f13', '', NULL),
(10755, 'en', 'advanced-access-manager', '5f4ab2660f3c22597c4bb2ce14f93b38', 'Render Access Link', NULL, NULL, 'LINE', NULL, 0, '', 'cce9f05676c51aa28f0870ac0c82813b', '', NULL),
(10756, 'en', 'advanced-access-manager', '82f6df75a25dc7d75ecbc6741bd39564', 'Render Access shortcut link under any post, page, custom post type, category, custom taxonomy title or user name.', NULL, NULL, 'LINE', NULL, 0, '', '929a1673f79d5e2f85f92ec9435cac1f', '', NULL),
(10757, 'en', 'advanced-access-manager', 'd5e2f9fd4664cb9dc4cc3ca2e3a94d98', 'Secure Login', NULL, NULL, 'LINE', NULL, 0, '', 'e995172cbba37474f8f05cc2e94c91dc', '', NULL),
(10758, 'en', 'advanced-access-manager', '186e57953be09b0974a202dfe2e09935', 'AAM comes with its own user login handler. With this feature you can add AJAX login widget to your frontend page that significantly enhance your website security.', NULL, NULL, 'LINE', NULL, 0, '', '409918687756781b9e551052fb8cb7ab', '', NULL),
(10759, 'en', 'advanced-access-manager', 'f3a581ede88d3d81205655f99ea21c16', 'XML-RPC WordPress API', NULL, NULL, 'LINE', NULL, 0, '', 'f8851255053bbe34afac10d9dc7053a1', '', NULL),
(10760, 'en', 'advanced-access-manager', 'c8b9b581ec32b0a88353258cc6b57611', 'Remote procedure call (RPC) interface is used to manage WordPress website content and features. For more information check %sXML-RPC Support%s article.', NULL, NULL, 'LINE', NULL, 0, '', 'ac4f0cb05c1b396f7fe3fc7d840a4b6c', '', NULL),
(10761, 'en', 'advanced-access-manager', '6dc63e63581c56009877b3cadc9d6af8', 'RESTful WordPress API', NULL, NULL, 'LINE', NULL, 0, '', '1c971636c535ca496e41f808ef72e1c9', '', NULL),
(10762, 'en', 'advanced-access-manager', 'bf10b4ab648f60a2a675b9057a9f7f1e', 'RESTful interface that is used to manage WordPress website content and features. For more information check %sREST API handbook%s.', NULL, NULL, 'LINE', NULL, 0, '', '70d77067784c4bd2973b5481d11645a8', '', NULL),
(10763, 'en', 'advanced-access-manager', '5b8707cfe14be9db3fa51512e8b43c8b', 'JWT Authentication', NULL, NULL, 'LINE', NULL, 0, '', '28c5ed4c4bc40368fc227f3b9869465a', '', NULL),
(10764, 'en', 'advanced-access-manager', '0a66f7b5a74c7bcf1412214d2f362fc3', '[Note!] PHP 5.4 or higher is required for this feature. Enable the ability to authenticate user with WordPress RESTful API and JWT token. For more information, check %sHow to authenticate WordPress user with JWT token%s article', NULL, NULL, 'LINE', NULL, 0, '', '7115544ea88e18764439325c9b77c63b', '', NULL),
(10765, 'en', 'advanced-access-manager', '4945681f145cb82f62fefcb6afaa0ff5', 'Multiple Roles Support', NULL, NULL, 'LINE', NULL, 0, '', 'ebc8ba1e2e610f48429a8f304ed388ef', '', NULL),
(10766, 'en', 'advanced-access-manager', '8b5c44e8d1807cc227dcac675b72dc7e', 'Enable support for multiple roles per use. The final access settings or general settings will be computed based on the mergin preferences. For more information check %sWordPress access control for users with multiple roles%s article.', NULL, NULL, 'LINE', NULL, 0, '', '0d050deed5ccda8cb201498c0cecf820', '', NULL),
(10767, 'en', 'advanced-access-manager', 'f94231025d51d15e8f3a216c1fc4f041', 'Support AAM Extensions', NULL, NULL, 'LINE', NULL, 0, '', '12231698daf15a7beccf2c61b0b48e3b', '', NULL),
(10768, 'en', 'advanced-access-manager', '7460f13d3d374a2fd074240d97e2ba06', 'AAM comes with the limited list of premium and free extensions that significantly enhance AAM behavior. You can disable support for AAM extension and any already installed extension will no longer be loaded during the website execution as well as website administrator will not be able to install new extensions.', NULL, NULL, 'LINE', NULL, 0, '', '591341ef8d1c06d8038bdd1a2029b7c6', '', NULL),
(10769, 'en', 'advanced-access-manager', '6a71063479367b4ab14fdb5ffe475789', 'AAM Cron Job', NULL, NULL, 'LINE', NULL, 0, '', '40fd326c13d6cf31049479cf5d91d543', '', NULL),
(10770, 'en', 'advanced-access-manager', 'a35347fab07892e957d52e9fa905b0de', 'AAM cron job executes periodically (typically once a day) to check for available updates for already installed extensions. Cron job is not executed if there are no installed extensions.', NULL, NULL, 'LINE', NULL, 0, '', 'b83424d7252ba6cadedc412c18d91537', '', NULL),
(10771, 'en', 'advanced-access-manager', '66922fde5c667d76200e82c54ac5d165', 'Media Files Access Control', NULL, NULL, 'LINE', NULL, 0, '', '488cfc9bfacc33e63f075cb1f615fdf9', '', NULL),
(10772, 'en', 'advanced-access-manager', '8b8cd8e70e1d5b5754514bc0d6bfe732', 'Allow AAM to manage a physically access to all media files located in the defined by the system [uploads] folder. [Note!] This feature requires additional steps as described in %sthis article%s.', NULL, NULL, 'LINE', NULL, 0, '', '294be7e627deda71dc788d75de61c7e3', '', NULL),
(10773, 'en', 'advanced-access-manager', '3dc8fbdc19de88725beacca15c0d5971', 'Manage Hidden Post Types', NULL, NULL, 'LINE', NULL, 0, '', '0e35fd0a58d742aed976bae0202b5d01', '', NULL),
(10774, 'en', 'advanced-access-manager', 'ec21f00de370ca41f12b438972c29c75', 'By default AAM allows you to manage access only to public post types on Posts & Terms tab. By enabling this feature, you also will be able to manage access to hidden post types like revisions, navigation menus or any other custom post types that are not registered as public.', NULL, NULL, 'LINE', NULL, 0, '', '190d0c656680104d6e702b30d10f6bdd', '', NULL),
(10775, 'en', 'advanced-access-manager', 'dc3dbfccb78e899697408aefe29aae3e', 'Login Timeout', NULL, NULL, 'LINE', NULL, 0, '', '1fc96b82276ea9ffbcf49946e551d8cb', '', NULL),
(10776, 'en', 'advanced-access-manager', '74f75fde2f20233f3be28ad834afced9', 'Delay the login process for 1 second (the value is configurable) to significantly reduce the chance for brute force or dictionary attack. For more information about this option please refer to %sHow does AAM Secure Login works%s.', NULL, NULL, 'LINE', NULL, 0, '', '643e0bc2953b125a2562f4f36ada05b9', '', NULL),
(10777, 'en', 'advanced-access-manager', '8c5b9b43bbaf169656162bb2fc61cfa2', 'One Session Per User', NULL, NULL, 'LINE', NULL, 0, '', '564535308ede4fdda74963dad394d9ac', '', NULL),
(10778, 'en', 'advanced-access-manager', 'e1c972ff2f53efe9a40731e057f506f7', 'Automatically destroy all other sessions for a user if he/she tries to login from different location. For more information about this option please refer to %sHow does AAM Secure Login works%s.', NULL, NULL, 'LINE', NULL, 0, '', '9db797afd27610ae6775b86bcb41af2f', '', NULL),
(10779, 'en', 'advanced-access-manager', '3fe1ac58399d02549dd2043045a36472', 'Brute Force Lockout', NULL, NULL, 'LINE', NULL, 0, '', 'b931bc40c254ca6a7fdcb80001cdc811', '', NULL),
(10780, 'en', 'advanced-access-manager', 'f9f504c27a598df107676474549e0472', 'Automatically reject login attempts if number of unsuccessful login attempts is more than 20 over the period of 2 minutes (both values are configurable). For more information about this option please refer to %sHow does AAM Secure Login works%s.', NULL, NULL, 'LINE', NULL, 0, '', 'b82cd20e3aa2cf01b51688b766823ee0', '', NULL),
(10783, 'en', 'default', '4d3d769b812b6faa6b76e1a8abaece2d', 'Active', NULL, NULL, 'LINE', NULL, 0, 'plugin', 'ae9e77b26ce8028661382e9eadeced4e', '', NULL),
(10784, 'en', 'default', '2a2301d66c4629c1bdf21901226e2a26', 'Latest Version Installed', NULL, NULL, 'LINE', NULL, 0, '', '9a3a361a2a9c52b30e5a360a6e0994d7', '', NULL),
(10785, 'en', 'default', 'c6448a2cdbc2074c41e2fe7249de1927', 'Categories and Tags Converter', NULL, NULL, 'LINE', NULL, 0, '', '40ef29ade9db93dd527862ec4b95c9e9', '', NULL),
(10786, 'en', 'default', 'b0ca6078939acc19b65f7d3a980a50ff', 'Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.', NULL, NULL, 'LINE', NULL, 0, '', 'e90a19994fd4faf5fab54f4358835df1', '', NULL),
(10787, 'en', 'default', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, NULL, 'LINE', NULL, 0, '', '73e9ba17e991f5898b5f2b0737c9ad4c', '', NULL),
(10788, 'en', 'default', 'fdb08da1ca19dfdbc05685ed83b1059d', '<a href="https://codex.wordpress.org/Tools_Screen">Documentation on Tools</a>', NULL, NULL, 'LINE', NULL, 0, '', 'f1411a4fea7d9379e0329d8e5ceee3ea', '', NULL),
(10789, 'en', 'advanced-access-manager', 'bf733d8a933c1601697f364223fc7ecb', 'Access', NULL, NULL, 'LINE', NULL, 0, '', '27ca861df400fc8a02527263294d6545', '', NULL),
(10799, 'en', 'advanced-access-manager', '1c867c191cc709432b3d645a64a37ef6', 'Access Manager', NULL, NULL, 'LINE', NULL, 0, '', 'b070b4f55cb621b5aae484f0388859c5', '', NULL),
(10800, 'en', 'advanced-access-manager', '9d3210afff99b67570b66eac48a7cb5a', 'Manage access to %s for visitors (any user that is not authenticated)', NULL, NULL, 'LINE', NULL, 0, '', '60786ea8b975ff2558eb28e692792a8f', '', NULL),
(10801, 'en', 'advanced-access-manager', '1e7043a7183be01949b393925d2642f2', 'Manage default access to %s for all users, roles and visitor. This includes Administrator role and yourself', NULL, NULL, 'LINE', NULL, 0, '', '022cecf86b4660f9bfd3bc35ac587494', '', NULL),
(10802, 'en', 'advanced-access-manager', 'aa91be21609b076c4950c78a3e3c470a', 'This feature is allowed only with [AAM Plus Package] extension.', NULL, NULL, 'LINE', NULL, 0, '', 'a289649402a66496e6df6371cd71d03f', '', NULL),
(10803, 'en', 'advanced-access-manager', '1cf61bda33eef80bca73bd323c4c35c4', 'Current user does not have enough capabilities to access any available dashboard page.', NULL, NULL, 'LINE', NULL, 0, '', '46eaeed5ecb5bbb132c5dff93d45c3e9', '', NULL),
(10804, 'en', 'advanced-access-manager', 'e5186b0c26dc201ba3604603957eafea', 'The list of top admin bar items is not initialized. Click "Refresh" button above.', NULL, NULL, 'LINE', NULL, 0, '', '8633092fe520b6a8985350ea61abeb80', '', NULL),
(10805, 'en', 'default', '8f7f4c1ce7a4f933663d10543562b096', 'About', NULL, NULL, 'LINE', NULL, 0, '', 'deeb715d221e5636bd38c62daef33d5f', '', NULL),
(10806, 'en', 'default', 'de84a90668925e51f0546ee10b52a8c9', 'Welcome to WordPress&nbsp;%s', NULL, NULL, 'LINE', NULL, 0, '', '02cff3ed05b16b9cd2e9600a6d91e751', '', NULL),
(10807, 'en', 'default', '0b140a27ead4284f8c21c555351383be', 'Thank you for updating to the latest version! WordPress %s will smooth your design workflow and keep you safe from coding errors.', NULL, NULL, 'LINE', NULL, 0, '', 'f0a0a7731dd87117993d4a70406d9839', '', NULL),
(10808, 'en', 'default', '69811f1b0413b571cb45ae1dac8bf159', 'What&#8217;s New', NULL, NULL, 'LINE', NULL, 0, '', '0fddd3884a08c5223e3865eaeaa816b7', '', NULL),
(10809, 'en', 'default', '948a2e3548aaf7f9941a3192fa607d51', 'Credits', NULL, NULL, 'LINE', NULL, 0, '', 'd9ea20d53f5089fb51d7eee860116db8', '', NULL),
(10810, 'en', 'default', '8715b7583c459ee5dc3f3d70b285ebf6', 'Freedoms', NULL, NULL, 'LINE', NULL, 0, '', 'dffa2057378de9653ed1a2a91566d92a', '', NULL),
(10811, 'en', 'default', 'c5f29bb36f9158d2e00f5d4dc213a0ff', 'Privacy', NULL, NULL, 'LINE', NULL, 0, '', '6599552c9e6c4d90ec0d59b4f6c911e9', '', NULL),
(10812, 'en', 'default', '5a45024b06d288f81635a8977e60e1ca', 'Maintenance and Security Releases', NULL, NULL, 'LINE', NULL, 0, '', 'd37ef9418e82a6c1a0276f53b686e762', '', NULL),
(10813, 'en', 'default', '06235b6f29533b9b5969b12a8df162d6', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bugs.', NULL, NULL, 'LINE', NULL, 0, '', '92da042deabc0a6a3b2479b8c699289e', '', NULL),
(10814, 'en', 'default', '4808b45295ba373d947b1407e34c31c7', 'For more information, see <a href="%s">the release notes</a>.', NULL, NULL, 'LINE', NULL, 0, '', 'cfb669095c507168e163c1bc7a288762', '', NULL),
(10815, 'en', 'default', '497641b5542b22dc5d6854613073ad40', '<strong>Version %1$s</strong> addressed %2$s bug.', NULL, NULL, 'LINE', NULL, 0, '', 'c13c1e08ef6aba59e1f4b7bc1ad35bf6', '', NULL),
(10816, 'en', 'default', 'ccb459ea6dea3238d4dd526be26dba4c', '<strong>Version %1$s</strong> addressed %2$s bugs.', NULL, NULL, 'LINE', NULL, 0, '', '89b615edaedeab58df789dd5e3a74e4a', '', NULL),
(10817, 'en', 'default', 'b7da9e6182489d12c9ecb11fbd306cb2', 'Major Customizer Improvements, Code Error Checking, and More! %s', NULL, NULL, 'LINE', NULL, 0, '', '0dc7f266e90834e108de7520f913cb1e', '', NULL),
(10818, 'en', 'default', 'cd61e834ef28051bae99e31d131c100a', 'Welcome to an improved Customizer workflow with design drafts, locking, scheduling, and preview links. What&#8217;s more, code syntax highlighting and error checking will make for a clean and smooth site building experience. Finally, if all that wasn&#8217;t pretty great, we&#8217;ve got a great new Gallery widget and improvements to theme browsing and switching.', NULL, NULL, 'LINE', NULL, 0, '', 'dc333a927a553863a9e96af78504f8ac', '', NULL),
(10819, 'en', 'default', '8cb2150020d2616c95b543277b310e90', 'Customizer Workflow Improved', NULL, NULL, 'LINE', NULL, 0, '', 'aa5084922c7a68b36f490d305dddda64', '', NULL),
(10820, 'en', 'default', '49be93e016c32a7da7121941ce1a29bd', 'Draft and Schedule Site Design Customizations', NULL, NULL, 'LINE', NULL, 0, '', '26db1513ac8fbfa1de72b5e825068680', '', NULL),
(10821, 'en', 'default', '59f603400b805b1de2d465999a14a8d1', 'Yes, you read that right. Just like you can draft and revise posts and schedule them to go live on the date and time you choose, you can now tinker with your site&#8217;s design and schedule those design changes to go live as you please.', NULL, NULL, 'LINE', NULL, 0, '', '92a26f1aeae59b581679ae5b9662ea6d', '', NULL),
(10822, 'en', 'default', 'e42624922c44bf04e9e5fa5468e956eb', 'Collaborate with Design Preview Links', NULL, NULL, 'LINE', NULL, 0, '', '45a07a39bf6800492d191d436173acb8', '', NULL),
(10823, 'en', 'default', '8a699dd848ef6733cdbdf91bd9fc1395', 'Need to get some feedback on proposed site design changes? WordPress 4.9 gives you a preview link you can send to your team and customers so that you can collect and integrate feedback before you schedule the changes to go live. Can we say collaboration&#43;&#43;?', NULL, NULL, 'LINE', NULL, 0, '', 'afb8db2f6bb1281b09336d8479ea2a9a', '', NULL),
(10824, 'en', 'default', 'a31a39e81495c50231ab6ed7d3f85ad1', 'Design Locking To Guard Your Changes', NULL, NULL, 'LINE', NULL, 0, '', '05af5f82d106fb1a11847a8db31ada28', '', NULL),
(10825, 'en', 'default', '070930b78275322fb297e4b5ea3dc427', 'Ever encounter a scenario where two designers walk into a project and designer A overrides designer B&#8217;s beautiful changes? WordPress 4.9&#8217;s design lock feature (similar to post locking) secures your draft design so that no one can make changes to it or erase all your hard work.', NULL, NULL, 'LINE', NULL, 0, '', '2ea75d07f01d51f55adfb63c5078fb36', '', NULL),
(10826, 'en', 'default', '7c7926d7f4cc9fa85424fb4cf24a5d1a', 'A Prompt to Protect Your Work', NULL, NULL, 'LINE', NULL, 0, '', '681771bf0b87f55fafae5e6115319622', '', NULL),
(10827, 'en', 'default', 'd70b95270024295a402c30dc85995616', 'Were you lured away from your desk before you saved your new draft design? Fear not, when you return, WordPress 4.9 will politely ask whether or not you&#8217;d like to save your unsaved changes.', NULL, NULL, 'LINE', NULL, 0, '', '7805e03865ab10f7123d69e64b1767ee', '', NULL),
(10828, 'en', 'default', '0d009a0c492150bd6d1f1b9cb7f7566e', 'Coding Enhancements', NULL, NULL, 'LINE', NULL, 0, '', 'd44100ef3ad93d0d7acb40085d2759fe', '', NULL),
(10829, 'en', 'default', '6b04cd47a4ee7c508df65b5ff5238677', 'Syntax Highlighting and Error Checking? Yes, Please!', NULL, NULL, 'LINE', NULL, 0, '', 'abda41c68438161cfe9b202eeee323e1', '', NULL),
(10830, 'en', 'default', '6b6cef3b0a34cedf3050e5742dcb75ba', 'You&#8217;ve got a display problem but can&#8217;t quite figure out exactly what went wrong in the CSS you lovingly wrote. With syntax highlighting and error checking for CSS editing and the Custom HTML widget introduced in WordPress 4.8.1, you&#8217;ll pinpoint coding errors quickly. Practically guaranteed to help you scan code more easily and suss out and fix code errors quickly.', NULL, NULL, 'LINE', NULL, 0, '', 'e4116e47954c7b10c687c08d63671b98', '', NULL),
(10831, 'en', 'default', 'b17cae1fb917fbca913a723b7cc32149', 'Sandbox for Safety', NULL, NULL, 'LINE', NULL, 0, '', '39bc14e77fe07da220c724f908b90c3d', '', NULL),
(10832, 'en', 'default', '445a3c1fa5bbae94fc96d0ffffd1f03d', 'The dreaded white screen. You&#8217;ll avoid it when working on themes and plugin code because WordPress 4.9 will warn you about saving an error. You&#8217;ll sleep better at night.', NULL, NULL, 'LINE', NULL, 0, '', 'a3d90099b9516eeb50523180b0d2cd98', '', NULL),
(10833, 'en', 'default', 'dd7d21a748f0d28323812bb7b5313551', 'Warning: Potential Danger Ahead!', NULL, NULL, 'LINE', NULL, 0, '', '8435bef858f8f4044f17f7fcc449ce13', '', NULL),
(10834, 'en', 'default', 'f44439cfd9036b3d7d9ebabf77e4454c', 'When you edit themes and plugins directly, WordPress 4.9 will politely warn you that this is a dangerous practice. It will recommend that you backup your files before saving, so they don&#8217;t get overwritten by the next update. Take the safe route: your future self will thank you. Your team and customers will thank you.', NULL, NULL, 'LINE', NULL, 0, '', '5ef97653ebcd956d1e4c50dc96e43758', '', NULL),
(10835, 'en', 'default', '2404caac817ca43ab6deb6c76d644169', 'Even More Widget Updates', NULL, NULL, 'LINE', NULL, 0, '', 'f6044d18c38a742668a43fc84c4a5776', '', NULL),
(10836, 'en', 'default', '3381f3479f10d0412df7ce542b32b439', 'The New Gallery Widget', NULL, NULL, 'LINE', NULL, 0, '', '8e113e03b8ebc674c2009ec2d000fe6b', '', NULL),
(10837, 'en', 'default', '6e9b613ac41ae96b661a6d32a7e0c1f4', 'An incremental improvement to the media changes hatched in WordPress 4.8, you can now add a gallery via widget. Yes!', NULL, NULL, 'LINE', NULL, 0, '', '14fc7e6d588335d42e1272086d3b47c3', '', NULL),
(10838, 'en', 'default', '2e0dcff574c4f3f5983a07d4df3aeb09', 'Press a Button, Add Media', NULL, NULL, 'LINE', NULL, 0, '', 'c73519149515c6313dff5270702b9c3b', '', NULL),
(10839, 'en', 'default', '50cad5840e61baa2e738f92d3bb956b4', 'Want to add media to your text widget? Embed images, video, and audio directly into the widget along with your text, with our simple but useful Add Media button. Woo!', NULL, NULL, 'LINE', NULL, 0, '', '9fc6ea8a22372eed13d0e8f47a42fa9f', '', NULL),
(10840, 'en', 'default', 'd31266590e63810ef668927098a195c8', 'Site Building Improvements', NULL, NULL, 'LINE', NULL, 0, '', 'e1ca61e147c629f2ca0a8c34c094ce07', '', NULL),
(10841, 'en', 'default', '57fc91556cc72d68825cfb72e1162998', 'More Reliable Theme Switching', NULL, NULL, 'LINE', NULL, 0, '', '4c554b5ddb74283f77e0659e2670973d', '', NULL);
INSERT INTO `wp_icl_strings` (`id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(10842, 'en', 'default', '191ec6e58017ed5fc068a91b2604e54e', 'When you switch themes, widgets sometimes think they can just up and move location. Improvements in WordPress 4.9 offer more persistent menu and widget placement when you decide it&#8217;s time for a new theme. Additionally, you can preview installed themes or download, install, and preview new themes right. Nothing says handy like being able to preview before you deploy. ', NULL, NULL, 'LINE', NULL, 0, '', '19d47f8ab3155708d972bb8b201db27d', '', NULL),
(10843, 'en', 'default', '230bee10540b48bd0252f0077f74d859', 'Better Menu Instructions = Less Confusion', NULL, NULL, 'LINE', NULL, 0, '', '81853b122cfdf28277c9a5688eaec173', '', NULL),
(10844, 'en', 'default', 'c58175f35e1622ed62c19e4e29756c3f', 'Were you confused by the steps to create a new menu? Perhaps no longer! We&#8217;ve ironed out the UX for a smoother menu creation process. Newly updated copy will guide you.', NULL, NULL, 'LINE', NULL, 0, '', 'a9e0bbd008b3e36609e17a8e15d61e11', '', NULL),
(10845, 'en', 'default', '38c45fd2e7fe181523d4b3fc1aeaff4a', 'Lend a Hand with Gutenberg %s', NULL, NULL, 'LINE', NULL, 0, '', '08f15c6b809d8ae33f3ba2edf85d4dc8', '', NULL),
(10846, 'en', 'default', '61a8161aaa6fd8fe6e6203323a3587a3', 'WordPress is working on a new way to create and control your content and we&#8217;d love to have your help. Interested in being an <a href="%s">early tester</a> or getting involved with the Gutenberg project? <a href="%s">Contribute on GitHub</a>.', NULL, NULL, 'LINE', NULL, 0, '', '5b7f9a3cb1b713e4f757f0eb4dba8f87', '', NULL),
(10847, 'en', 'default', '949e7a0406f1caf30292f0c901c686c3', 'https://wordpress.org/plugins/gutenberg/', NULL, NULL, 'LINE', NULL, 0, '', '1f269dbe177a32ad60ab4c6841dd7199', '', NULL),
(10848, 'en', 'default', '70666d9d1f37cb69190ae68eefd072b3', 'Developer Happiness %s', NULL, NULL, 'LINE', NULL, 0, '', 'fe84b691e6dd1387cffb4a1b3194d908', '', NULL),
(10849, 'en', 'default', '1421423f384748e31b5df79403b7c256', 'Customizer JS API Improvements', NULL, NULL, 'LINE', NULL, 0, '', '76ed8ae5780f302395e545f3e3191ea1', '', NULL),
(10850, 'en', 'default', '3f1fd28a5e83208f2e13fb5162bcec9d', 'We&#8217;ve made numerous improvements to the Customizer JS API in WordPress 4.9, eliminating many pain points and making it just as easy to work with as the PHP API. There are also new base control templates, a date/time control, and section/panel/global notifications to name a few. <a href="%s">Check out the full list.</a>', NULL, NULL, 'LINE', NULL, 0, '', '3ab0f781146fbfab9151a1fe0e6f2265', '', NULL),
(10851, 'en', 'default', '4c188acfb7ab8922ae1259232a198fa9', 'CodeMirror available for use in your themes and plugins', NULL, NULL, 'LINE', NULL, 0, '', '7ea2233fa2378785c85cb20c2988be5b', '', NULL),
(10852, 'en', 'default', '04f27ee370a16937b3414fabd9537601', 'We&#8217;ve introduced a new code editing library, CodeMirror, for use within core. Use it to improve any code writing or editing experiences within your plugins, like CSS or JavaScript include fields.', NULL, NULL, 'LINE', NULL, 0, '', 'fc106b11f9598b16944b73e2166d52f3', '', NULL),
(10853, 'en', 'default', 'b474ad1cf004b0446c0901c6e198757e', 'MediaElement.js upgraded to 4.2.6', NULL, NULL, 'LINE', NULL, 0, '', '674e62a12c01e5b3323cd8cbc6732b05', '', NULL),
(10854, 'en', 'default', 'b81803fe6cddddb8f3ef117583deec60', 'WordPress 4.9 includes an upgraded version of MediaElement.js, which removes dependencies on jQuery, improves accessibility, modernizes the UI, and fixes many bugs.', NULL, NULL, 'LINE', NULL, 0, '', '88d155b14917a6a0c9d1430ef4cc01d5', '', NULL),
(10855, 'en', 'default', 'c1a2348d150d16b3da6ba4f8c4f3c930', 'Improvements to Roles and Capabilities', NULL, NULL, 'LINE', NULL, 0, '', 'c1591a3df461fbd58dd72344d2b1942f', '', NULL),
(10856, 'en', 'default', '84fd0aedd92ac4d362658a9ed687f1a8', 'New capabilities have been introduced that allow granular management of plugins and translation files. In addition, the site switching process in multisite has been fine-tuned to update the available roles and capabilities in a more reliable and coherent way.', NULL, NULL, 'LINE', NULL, 0, '', '15ddf582272e2677ebc588edc176eaf4', '', NULL),
(10857, 'en', 'default', '2e67d78426f90dd1a3cfbd9b8bdb0897', 'Go to Dashboard &rarr; Home', NULL, NULL, 'LINE', NULL, 0, '', '0a63d89382cd7d951f7bd084540ae67a', '', NULL),
(10864, 'en', 'default', 'd40cc8ff065d6dfdfad53b79722a2624', 'Edit Plugins', NULL, NULL, 'LINE', NULL, 0, '', '0e29406d9d18efb17657abb634603e8b', '', NULL),
(10865, 'en', 'default', 'c0ed5e3f5e633991901390dd59336cc6', 'You can use the editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.', NULL, NULL, 'LINE', NULL, 0, '', 'f835ba39685bf5ad176052a11180bb18', '', NULL),
(10866, 'en', 'default', '8a65d903fd1c00d5917421ace60ab4a1', 'Choose a plugin to edit from the dropdown menu and click the Select button. Click once on any file name to load it in the editor, and make your changes. Don&#8217;t forget to save your changes (Update File) when you&#8217;re finished.', NULL, NULL, 'LINE', NULL, 0, '', 'd4d68515ec452eef50f486865b88f13d', '', NULL),
(10867, 'en', 'default', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, NULL, 'LINE', NULL, 0, '', 'f53280634c7e03c2413c208d3e3e68b2', '', NULL),
(10868, 'en', 'default', '141eda2001c8a2a55dc035ab09d74554', 'When using a keyboard to navigate:', NULL, NULL, 'LINE', NULL, 0, '', '33b00b20a898dc932f07b2542bff0c54', '', NULL),
(10869, 'en', 'default', '0f3b5be67bc58ea00af24d2c1634c897', 'In the editing area, the Tab key enters a tab character.', NULL, NULL, 'LINE', NULL, 0, '', 'e65250bbd222d89a4f24f11f0422ee17', '', NULL),
(10870, 'en', 'default', '940995ecad89598fc6c26af8194c1e0e', 'To move away from this area, press the Esc key followed by the Tab key.', NULL, NULL, 'LINE', NULL, 0, '', '2a6cd7f3fe782d1f45fd5f101057afa8', '', NULL),
(10871, 'en', 'default', '6e8296e353bbf755a11226d10bbe89a4', 'Screen reader users: when in forms mode, you may need to press the Esc key twice.', NULL, NULL, 'LINE', NULL, 0, '', '6e6750c57d09246d911afdbcc0a04254', '', NULL),
(10872, 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, NULL, 'LINE', NULL, 0, '', '8c4742c33256ee314435258e3a200070', '', NULL),
(10873, 'en', 'default', '7c2a173c8cece4c3d4c67bb7323dff9b', '<a href="https://codex.wordpress.org/Plugins_Editor_Screen">Documentation on Editing Plugins</a>', NULL, NULL, 'LINE', NULL, 0, '', 'ac9ff5c8058e3846474f9c67fdde23b5', '', NULL),
(10874, 'en', 'default', '0df53b9aa595a3cb78e04f1956388135', '<a href="https://codex.wordpress.org/Writing_a_Plugin">Documentation on Writing Plugins</a>', NULL, NULL, 'LINE', NULL, 0, '', 'b75f092093350a1b65785c523f74ffb0', '', NULL),
