(10885, 'en', 'default', '8f0af66fe8ea7580813cbf4b14b852bd', 'Your PHP code changes were rolled back due to an error on line %1$s of file %2$s. Please fix and try saving again.', NULL, NULL, 'LINE', NULL, 0, '', 'fecacb337d6c132227ad06edaf45ed2c', '', NULL),
(10886, 'en', 'default', '4d24d578a5927f1b57cca938c9634429', 'You need to make this file writable before you can save your changes. See <a href="https://codex.wordpress.org/Changing_File_Permissions">the Codex</a> for more information.', NULL, NULL, 'LINE', NULL, 0, '', '23f5f43ef597a9ca39b41090de27cbcf', '', NULL),
(10887, 'en', 'default', '3ccd389ff1f66b148bb8ed1f6350c9c7', 'Update anyway, even though it might break your site?', NULL, NULL, 'LINE', NULL, 0, '', '628924f6fefcbd6579addbc3a43056d6', '', NULL),
(10888, 'en', 'default', '40499d0ffd90e6885388ad2284c89dcd', 'Heads up!', NULL, NULL, 'LINE', NULL, 0, '', 'e4ba694111359127411e50ac3d108487', '', NULL),
(10889, 'en', 'default', 'f8ba38900d10b5b21aee002e9e7bd51b', 'You appear to be making direct edits to your plugin in the WordPress dashboard. We recommend that you don&#8217;t! Editing plugins directly may introduce incompatibilities that break your site and your changes may be lost in future updates.', NULL, NULL, 'LINE', NULL, 0, '', 'f826278325752cd0128cabb05d582280', '', NULL),
(10890, 'en', 'default', 'd9dff3fdbe97394dbe242685a2baaddf', 'If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.', NULL, NULL, 'LINE', NULL, 0, '', 'b29b7284479d958fc9d549fee1073e52', '', NULL),
